description:
Воканамет показаний дорослим пацієнтам з цукровим діабетом ІІ типу для покращення контролю глікемії як додатковий засіб до дієти та фізичного навантаження:
- якщо належний контроль рівня глюкози не досягається при застосуванні максимально переносимих доз метформіну як монопрепарату;
- якщо належний контроль рівня глюкози не досягається при застосуванні максимально переносимих доз метформіну разом з іншими лікарськими засобами, що знижують рівень глюкози, включаючи інсулін;
- у разі лікування із застосуванням комбінації канагліфлозину та метформіну у вигляді окремих таблеток.

Офіційний дилер сонячних панелей, інверторів, АКБ та комплектуючих до них в Україні.

Здійснюємо продаж по всій Україні, а також установку по Дніпропетровській області!

Безкоштовна індивідуальна консультація клієнта та підбір систем під будь-який бюджет.

Наші переваги
⁃ Найкраща вартість по Україні;
⁃ Гарантія якості;
⁃ Знижкова система та оптові ціни;
⁃ Безкоштовний прорахунок вартості;
- Безкоштовна консультація;
- Можливість включення установки відразу на замовлення.

Зарекомендували себе як перевірений постачальник із якісним товаром.

Можливий як готівковий, так і безготівковий розрахунок.

Телефонуйте або пишіть на ВАЙБЕР 06******58 Давид

Я практикующий психолог, волонтер в нескольких проектах психологической помощи для украинцев. Постоянно обучаюсь ( арт терапия, первая кризисная помощь, работа с беженцами и многое другое). 

Провожу психологические консультации для украинцев бесплатно в текстовом или телефонном режиме. Свободная оплата (донат) и отзыв по желанию.

Основные направления работы:

- первая кризисная помощь;
- стресс;
- тревожность;
-детско-родительские отношения;
- работа с пострадавшими во время войны;
- работа с беженцами и переселенцами, адаптация;
- чувство вины и стыда;
- неуверенность;
- страхи;
- нарушения пищевого поведения.

Также беру в работу клиентов с другими запросами ( уточняйте). Работаю только со взрослыми. 

Пишите мне на viber/telegram или ОЛХ, договоримся о времени консультации.
